import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import { Provider } from 'react-redux';
import { createStore, combineReducers } from 'redux';

import LayoutReducer from './store/reducers/Layout';
import AboutUsReducer from './store/reducers/AboutUs';
import InnovationReducer from './store/reducers/Innovation';
//import OurWorkReducer from './store/reducers/OurWork';
//import WhatWeDoReducer from './store/reducers/WhatWeDo';

//const composeEnhancers = process.env.NODE_ENV === 'development' ? window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__ : null || compose;

const rootReducer = combineReducers({
  layout: LayoutReducer,
  aboutUs: AboutUsReducer,
  innovation: InnovationReducer
});

const store = createStore(rootReducer);


ReactDOM.render(
  <React.StrictMode>
    <Provider store={store}>
          <App />
    </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
